/**
  dc-icons variables used by design team with spectrum fallbacks
  spectrum light theme varables: https://github.com/adobe/spectrum-css/blob/main/components/vars/css/themes/spectrum-light.css
  spectrum dark theme variables: https://github.com/adobe/spectrum-css/blob/main/components/vars/css/themes/spectrum-dark.css
**/
.spectrum {
  --iconCutout: var(--spectrum-global-color-gray-75);
  --iconBackground: var(--spectrum-global-color-gray-50);
  --iconFillMedium: var(--spectrum-global-color-gray-500);
  --iconFillPale: var(--spectrum-global-color-gray-400);
  --iconFillLight: var(--spectrum-global-color-gray-300);
  --iconFill: var(--spectrum-global-color-gray-700);
  --iconFillStrong: var(--spectrum-global-color-gray-900);
  --iconBlue: var(--spectrum-global-color-blue-500);
  --iconGreen: var(--spectrum-global-color-green-500);
  --iconRed: var(--spectrum-global-color-red-500);
  --iconOrange: var(--spectrum-global-color-orange-500);
  --iconPurple: var(--spectrum-global-color-purple-500);
  --iconIndigo: var(--spectrum-global-color-indigo-500);
  --iconCelery: var(--spectrum-global-color-celery-500);
  --iconMagenta: var(--spectrum-global-color-magenta-500);
  --iconYellow: var(--spectrum-global-color-yellow-500);
  --iconFuchsia: var(--spectrum-global-color-fuchsia-500);
  --iconSeafoam: var(--spectrum-global-color-seafoam-500);
  --iconChartreuse: var(--spectrum-global-color-chartreuse-500);
}

/**
  dc-icons variables used by design team with custom light colors
**/
.spectrum--light {
  --iconAcrobatScan: rgb(25, 179, 184);
  --iconAcrobatRed: rgb(250, 15, 0);
  --iconAcrobatBatchBg: rgb(44, 44, 44);
}

/**
  dc-icons variables used by design team with custom dark colors
**/
.spectrum--dark {
  --iconAcrobatScan: rgb(42, 187, 191);
  --iconAcrobatRed: rgb(255, 123, 130);
  --iconAcrobatBatchBg: rgb(90, 90, 90);
}


/**
  dc-icons variable implemetation per user interaction state
**/

.spectrum button.is-selected {
  --iconFill: var(--spectrum-global-color-gray-900);
}

.spectrum button.focus-ring {
  --iconFill: var(--spectrum-global-color-gray-900);
}

.spectrum button:hover {
  --iconFill: var(--spectrum-global-color-gray-900);
}

.spectrum button:disabled,
.spectrum button.is-disabled {
  --iconFill: var(--spectrum-global-color-gray-400);
}

.sdk-ProgressView-progressBG {
    background-color: rgba(0, 0, 0, 0.3);
}

.sdk-ProgressView-progressBG-LB-ModernViewer {
    background-color: var(--progressViewBgColorLB);
}

.sdk-UploadProgressView-progressBG {
    background-color: var(--spectrum-global-color-gray-100);
}

.sdk-ProgressView-progressFixed {
    background-color: rgba(0, 0, 0, 0.3);
    color: var(--spectrum-global-color-gray-800);
    height: 100vh;
    left: 0;
    position: fixed;
    top: 0;
    width: 100vw;
    z-index: 999999;
}

.sdk-ProgressView-progress {
    color: var(--spectrum-global-color-gray-800);
    height: 100%;
    position: absolute;
    width: 100%;
    z-index: 999999;
}

.sdk-ProgressView-progressText {
    color: var(--spectrum-global-color-gray-50);
    font-size: 16px;
    left: 50%;
    margin-top: 55px;
    position: absolute;
    top: 50%;
    transform: translate(-50%, -50%);
}

.sdk-ProgressView-progressTextInLine {
    color: var(--spectrum-global-color-gray-50);
    font-size: 16px;
    left: 50%;
    margin-top: 55px;
    position: absolute;
    top: 150px;
    transform: translate(-50%, -50%);
}

.sdk-ProgressText-light {
    color: var(--progressTextColor);
}

.sdk-ProgressText-dark {
    color: #505050;
}

.sdk-ProgressText-ModernViewer-LightBox {
    color: var(--spectrum-global-color-gray-800);
}

.sdk-ProgressView-progressWaitInLine {
    color: var(--spectrum-global-color-gray-50);
    font-size: 16px;
    left: 50%;
    margin-top: 55px;
    position: absolute;
    top: 100px;
    transform: translate(-50%, -50%);
}

.sdk-ProgressView-centered {
    color: var(--spectrum-global-color-gray-50);
    font-size: 16px;
    left: 50%;
    position: absolute;
    top: 50%;
    transform: translate(-50%, -50%);
}

.spectrum--light {
    --progressViewBgColorLB: rgba(255, 255, 255, 0.8);
    --progressTextColor: var(--spectrum-global-color-gray-50);
}

.spectrum--dark {
    --progressViewBgColorLB: rgba(50, 50, 50, 0.8);
    --progressTextColor: var(--spectrum-global-color-gray-800);
}

.sdk-FullScreenModal-modalDialog {
    background-image: linear-gradient(to bottom, rgba(44, 44, 34, 0.5), rgba(44, 44, 34, 0));
    bottom: 0;
    color: #4b4b4b;
    display: flex;
    flex-direction: column;
    height: 100%;
    left: 0;
    position: absolute;
    right: 0;
    top: 0;
    width: 100%;
    z-index: 999999;
}

.sdk-FullScreenModal-branding {
    height: 24px;
    padding: 8px;
    width: 24px;
}

.sdk-FullScreenModal-fileInfo {
    flex-grow: 1;
    padding-top: 8px;
}

.sdk-FullScreenModal-header {
    display: flex;
    height: 35px;
    width: 100%;
}

.sdk-FullScreenModal-fileInfo-fileName {
    color: #fff;
    display: block;
    font-size: 14px;
    font-weight: lighter;
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
}

.sdk-FullScreenModal-fileInfo-fileExtension {
    color: #fff;
    font-size: 11px;
    letter-spacing: 0.666px;
    margin-left: 10px;
    padding-top: 3px;
    text-transform: uppercase;
}

.sdk-FullScreenModal-maximizeIcon {
    align-items: center;
    background-color: #fff;
    border-radius: 2px;
    display: flex;
    height: 32px;
    justify-content: center;
    left: 50%;
    position: absolute;
    top: 50%;
    transform: translate(-50%, -50%);
    width: 32px;
}

.sdk-Preview-main {
    display: flex;
    flex-direction: row;
    height: 100%;
    overflow: hidden;
    width: 100%;
}

.sdk-Preview-middle {
    height: 100%;
    overflow-x: auto;
    width: 100%;
}

.sdk-Preview-preview {
    border: 0;
    height: 100%;
    width: 100%;
}

.sdk-Preview-previewTop {
    left: 0;
    top: 0;
}

.sdk-Preview-hide {
    visibility: hidden;
}

.sdk-App {
    display: flex;
    height: 100%;
    width: 100%;
}

.preview {
    height: 100%;
    min-width: 0;
    position: relative;
    width: 100%;
}

.side-Nav {
    height: calc((100vh - 64px));
}

.spectrum--dark {
    --bgColorLB: rgba(50, 50, 50, 0.8);
    --bgColor: var(--spectrum-global-color-gray-50);
}

.spectrum--light {
    --bgColorLB: rgba(248, 248, 248, 0.8);
    --bgColor: var(--spectrum-global-color-gray-100);
}

.sdk-CustomActions-actions {
    display: flex;
    flex: 0 0 auto;
    flex-direction: row;
    overflow: hidden;
}

.sdk-CustomActions-actionItem {
    margin: 0 4px;
}

/* Forcing fill as we don't have dark theme yet */
.sdk-CustomActions-actionItem svg g {
    fill: #6a6a6a !important;
}

.sdk-CustomActions-actionItemWhite {
    margin: 0 4px;
}

/*
.actionItemWhite button svg path {
    fill: #fff;
}
*/

.sdk-CustomActions-actionItemHidden {
    display: none;
}

/* overriding tools disabled class fill (from comments dropin) to make them look enabled */
.sdk-CustomActions-actionItem-inactive svg path {
    fill: #707070 !important;
}

.sdk-CustomActions-actionsModernViewer .sdk-CustomActions-actionItem svg path {
    fill: var(--spectrum-global-color-gray-700) !important;
}

.sdk-CustomActions-actionsModernViewer .sdk-CustomActions-actionItem:hover svg path {
    fill: var(--spectrum-global-color-gray-900) !important;
}

.sdk-CustomActions-separator {
    margin: 0 5px;
}

button > span {
    display: inline-block;
}

.sdk-SideMenu-sideMenuActionItem {
    display: flex;
    font-size: 14px;
    height: 40px;
    margin: 0 !important;
    outline: none !important;
    padding-left: 16px;
    text-align: left;
    width: 100%;
}

.sdk-SideMenu-sideMenuActionItem .spectrum-Icon {
    align-self: center;
}

.sdk-SideMenu-sideMenuActionItem:hover {
    background-color: var(--spectrum-global-color-gray-100) !important;
}

.sdk-SideMenu-menuDivider {
    background-color: var(--spectrum-global-color-gray-400);
    border: none;
    height: 1px;
    margin: 0 15px !important;
}

.sdk-SideMenu-emailDisplay {
    color: #707070;
    cursor: pointer;
    font-size: 12px;
    line-height: 12px;
    padding: 0 12px 12px 42px;
}

.sdk-SideMenu-emailDisplayToolTip {
    text-align: center;
}

.sdk-SideMenu-emailDisplayToolTip .spectrum-Tooltip-label {
    max-width: 170px !important;
}

.sdk-SideMenu-sideMenuActionItem .spectrum-ActionButton-label {
    color: var(--spectrum-global-color-gray-700);
    padding-left: 10px !important;
    text-align: left !important;
}

.sdk-SideMenu-sideMenuActionItem svg g {
    fill: #6a6a6a !important;
}

.sdk-SideMenu-sideMenuActionItemModernViewer .spectrum-Icon g {
    fill: var(--iconFill, #464646) !important;
}

.sdk-SideMenu {
    display: block;
}

@media (forced-colors: active) {
    .sdk-SideMenu-sideMenuActionItem:hover {
        background-color: Highlight !important;
    }
}

:root {
    --header-height: 47px;
}

.sdk-HeaderView-headerForSizedContainer {
    opacity: 0;
    position: absolute !important;
    transition: opacity 1.5s ease;
}

.sdk-HeaderView-headerForSizedContainerWithSearch {
    opacity: 1;
    position: absolute !important;
}

.sdk-HeaderView-header {
    align-items: center;
    background-color: var(--spectrum-global-color-gray-100);
    border-bottom: solid 1px var(--spectrum-global-color-gray-200);
    box-sizing: border-box;
    display: flex;
    height: var(--header-height);
    max-height: var(--header-height);
    outline: 0;
    position: relative;
    width: 100%;
    z-index: 1001;
}

.sdk-HeaderView-header-modernViewer {
    background-color: var(--spectrum-global-color-gray-50);
}

.sdk-HeaderView-dummyDiv {
    display: inline-flex;
    flex-direction: row;
    margin: 0 auto;
}

.sdk-HeaderView-branding {
    align-items: center;
    display: flex;
    flex: 0 0 auto;
    height: 100%;
    margin-left: 20px;
    overflow: hidden;
}

.sdk-HeaderView-centreInfo {
    align-items: center;
    display: flex;
    flex: 1 1 auto;
    height: 100%;
    position: absolute;
    text-align: center;
    width: 100%;
}

.sdk-HeaderView-leftFileinfoWithBranding {
    justify-content: left;
    margin-left: 60px;
    text-align: left !important;
}

.sdk-HeaderView-leftFileinfoWithBrandingAndLeftButton {
    justify-content: left;
    margin-left: 110px;
    text-align: left !important;
}

.sdk-HeaderView-leftFileinfoWithoutBranding {
    justify-content: left;
    margin-left: 0;
    text-align: left !important;
}

.sdk-HeaderView-sideMenuButton {
    margin: 0 8px 0 0;
}

.sdk-HeaderView-actionButton .spectrum-Icon {
    height: 14px;
    margin-left: 5px;
    width: 14px;
}

button {
    padding: 0 5px;
}

.readAloudBranding {
    display: flex;
    margin-left: 8px;
}

.readAloudComponent {
    align-items: center;
    display: flex;
    left: 50%;
    position: fixed;
    transform: translateX(-50%);
}

.readAloudClose {
    margin-left: auto;
    margin-right: 30px;
}

.sdk-HeaderView-navSection {
    align-items: center;
    display: grid;
}

.sdk-HeaderView-toolsSection {
    align-items: center;
    display: grid;
    margin-right: 12px;
}

@media (max-width: 550px) {
    .sdk-HeaderView-branding {
        flex: 1 1 auto;
        min-width: 0;
    }

    .sdk-HeaderView-actionButton {
        display: none !important;
    }
}

@media screen and (-ms-high-contrast: active), (-ms-high-contrast: none) {
    .sdk-HeaderView-centreInfo {
        position: relative !important;
    }
}

@media (max-width: 400px) {
    .sdk-HeaderView-leftFileinfoWithBranding {
        margin-left: 12px !important;
    }

    .sdk-HeaderView-leftFileinfoWithBrandingAndLeftButton {
        margin-left: 62px !important;
    }
}

@media (min-width: 400px) and (max-width: 550px) {
    .sdk-HeaderView-leftFileinfoWithBranding {
        margin-left: 12px !important;
    }

    .sdk-HeaderView-leftFileinfoWithBrandingAndLeftButton {
        margin-left: 62px !important;
    }
}

@media (min-width: 550px) and (max-width: 768px) {
    .sdk-HeaderView-leftFileinfoWithBranding {
        margin-left: 12px !important;
    }

    .sdk-HeaderView-leftFileinfoWithBrandingAndLeftButton {
        margin-left: 62px !important;
    }
}

@media (min-width: 768px) and (max-width: 1023px) {
    .sdk-HeaderView-leftFileinfoWithBranding {
        margin-left: 12px !important;
    }

    .sdk-HeaderView-leftFileinfoWithBrandingAndLeftButton {
        margin-left: 62px !important;
    }
}

@media (min-width: 1023px) and (max-width: 1280px) {
    .sdk-HeaderView-leftFileinfoWithBranding {
        margin-left: 12px !important;
    }

    .sdk-HeaderView-leftFileinfoWithBrandingAndLeftButton {
        margin-left: 62px !important;
    }
}

.sdk-HeaderFileInfoView-header {
    display: inline-flex;
    flex-direction: row;
    margin: 0 auto;
}

.sdk-HeaderFileInfoView-header.sdk-HeaderFileInfoView-header-fileInfoHorizontallyCentered {
    margin: 0 auto !important;
}

.sdk-HeaderFileInfoView-headerNoBranding {
    display: inline-flex;
    flex-direction: row;
    margin: 0 auto;
}

.sdk-HeaderFileInfoView-displayNone {
    display: none !important;
}

.sdk-HeaderFileInfoView-readOnly {
    margin-top: -2px;
}

.sdk-HeaderFileInfoView-fileStatus {
    margin: 5px 0 0 0 !important;
}

.sdk-HeaderFileInfoView-fileStatus-modernViewer {
    color: var(--spectrum-global-color-gray-700);
    font-size: 12px;
    margin-right: 16px;
    margin-top: 7px;
}

.sdk-HeaderFileInfoView-fileStatus span {
    margin-right: 10px;
}

.sdk-HeaderFileInfoView-header > span:nth-child(3) {
    margin-left: -12px;
}

.sdk-HeaderFileInfoView-save {
    margin-top: -7px;
}

.sdk-HeaderFileInfoView-breadcrumbs .focus-ring {
    text-decoration: underline;
}

.sdk-HeaderFileInfoView-fileBreadCrumbWhite {
    /* color: #fff !important; */
    color: var(--spectrum-global-color-gray-800) !important;
}

.sdk-HeaderFileInfoView-fileBreadCrumbNormal {
    color: var(--spectrum-global-color-gray-800) !important;
}

.sdk-HeaderFileInfoView-fileBreadCrumb {
    display: block;
    font-size: 14px;
    font-weight: normal !important;
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
}

.sdk-HeaderFileInfoView-linkBreadCrumb {
    color: var(--spectrum-global-color-gray-800) !important;
    font-size: 14px;
    font-weight: normal !important;
}

.sdk-HeaderFileInfoView-homeLink {
    color: var(--spectrum-global-color-gray-50) !important;
}

.sdk-HeaderFileInfoView-saveToast {
    margin-left: 20px;
    padding-top: 5px;
    position: fixed;
    top: 50px;
}

.sdk-HeaderFileInfoView-saveToast .spectrum-UIIcon-CrossMedium {
    margin: 4px;
}

.sdk-HeaderFileInfoView-saveToast > .spectrum-Icon {
    display: none;
}

.sdk-HeaderFileInfoView-saveToast > .spectrum-Toast-buttons {
    border: none;
}

.sdk-HeaderFileInfoView-saveToast .spectrum-Toast-content {
    font-size: 13px;
    padding-right: 0;
    width: 190px;
    word-wrap: break-word;
}

.sdk-HeaderFileInfoView-statusBlock {
    display: flex;
    flex-direction: row;
    height: 18px;
    margin-left: 0;
    margin-top: 8px;
    min-width: 60px;
}

.sdk-HeaderFileInfoView-statusBlockBorder {
    border-left: 1px solid #d6d6d6;
    padding-left: 10px;
}

.sdk-HeaderFileInfoView-details {
    color: var(--spectrum-global-color-gray-700);
    font-size: 11px;
    letter-spacing: 0.666px;
    margin-left: 10px;
    padding-top: 3px;
    text-transform: uppercase;
}

.sdk-HeaderFileInfoView-seperatorLine {
    display: none;
}

.sdk-HeaderFileInfoView-readOnlyTooltip {
    background: none;
    border: none;
    font-weight: inherit;
    margin-top: -6px;
    padding: 0;
}

.sdk-HeaderFileInfoView-readOnlyTooltip:hover {
    background: none !important;
}

.spectrum-Breadcrumbs-itemLink:last-child {
    display: inline-flex;
    text-decoration: none !important;
}

@media screen and (-ms-high-contrast: active), (-ms-high-contrast: none) {
    .sdk-HeaderFileInfoView-saveToast {
        margin-left: -35px !important;
    }
}

    .sdk-HeaderFileInfoView-fileBreadCrumb {
        max-width: 70px;
    }

    .sdk-HeaderFileInfoView-fileBreadCrumbINT {

    }

    }

    }

    }

    }
